function Index() {
    let id = 0
    fetch('http://localhost:8080')
        .then(r => r.json())
        .then(r => {
            return (
                <div>
                    <h1>{id}</h1>
                </div>
            )
        }).catch(e => {
            console.log(e)
        })

}
export default Index
